@philipduff @philipduff Hi, I am sorry to hear your bag is delayed. I can't check the status via our system, that is handled by the Baggage Service.
You can track your bag and contact the Baggage Service here: https://t.co/2zwsPbiovs
Kind regards, Mikael

@philroche Hi Philip
Contact our customer service via Facebook messenger or live chat    https://t.co/Ec5v80W12W        (choose country and go down to contact us and both chat and phone is available) and they will inform you. 
Kind regards /Anna

@Springer_Bell Hi, I am sorry to hear that the wheelchair is still missing. Please contact the local baggage service at the airport where the wheelchair was reported missing at and they may have more information https://t.co/We1FdD7ZiM

Best regards,
Anton.

@KeithFerrier Hello, yes the SAS app is available in Canada as well, it can be downloaded from your app store/google play store on smartphone and tablet.

Best regards,
Anton.

@maestral0 Hello, please contact us by chat or phone to see if we can help to register your missing baggage report. Otherwise you need to contact baggage service for help: https://t.co/xHUSCD2Zj7
Best regards,
Stina

@IvarDale Hej!

För närvarande har vi ett mycket stort antal inkommande ärenden, vilket skapar en längre hanteringstid än vanligt just nu. Vi ber om ursäkt över detta och tackar stort för ert tålamod! Har ni fått ett Case nummer så är ert ärende under hantering.

Bästa hälsningar, Angelica

@Qualityresort Hi!

If this is regarding a case that has been filed at our department Customer Care, the handling time for the moment is unfortunately longer than usual due to a very high amount of incoming cases. We do apologize for this.

Kind regards, Angelica

@JoeyGiancaspr07 Hello! We are truly sorry that your bag was lost. If you haven't reported it lost yet, you need to do so here: https://t.co/uHX1YFCLU3 or call our baggage service here: https://t.co/D7OLjzNpTk for further assist please contact us through customer service.

Warm regards,
Jenny

@Andreja We are unfortunately not able to assist with delayed baggage cases over social media. Please try calling the baggage service support on Monday for more information about that baggage, if you have not heard anything before then https://t.co/We1FdD7ZiM

Best regards,
Anton.

@Isaac_Lumu84 Hi, I was not able to find any information indicating that SAS has it's own service desk or ticket office at Schiphol airport.

Best regards,
Anton.

@philipduff Hello! If you have missed the flight due to the long security line, please visit the SAS ticket desk at the airport for help with rebooking to the next possible flight.

Warm regards,
Jenny

@EsqSimbar Hello! We are truly sorry for your damaged bags! For more help with your case please contact our customer service. You can also find information here: https://t.co/KQdOdrH9TM Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@Isaac_Lumu84 Hello, if they were not able to rebook your ticket you need to buy a new ticket. Most tickets only allow rebooking until 1 hour before departure.

Best regards,
Anton.

@ndbrandolini Hi, vegetarian meal is considered a special meal and must be requested through customer service at least 24 hours before departure. To contact customer service either write to us on live chat or call us https://t.co/b3QIqPk7bj

Best regards,
Anton.

@Isaac_Lumu84 Hello! For short haul flights as this one, the gate closes 20 minutes before departure. If you would miss your departure please go to one of our ticket desks for help with rebooking to the next flight.

Warm regards,
Jenny

@Andreja We understand your worries and we are once again truly sorry for your delayed bag! For further assist with your delayed bag, please call our baggage service on the proper airport. Numbers can be found here: https://t.co/ZV9bTO3uo2

Warm regards,
Jenny

@Abebab We also have a baggage service number that you can call, in Stockholm on +46 771 22 42 43 With opening hours from 9 AM to 4 PM monday-friday Scandinavian time.

Warm regards,
Jenny

@Abebab Hello! We are truly sorry for this inconvenience! For further assist with your delayed baggage, please contact our baggage service on phone +353 180 80 381

Warm regards,
Jenny

@rozfocker69 Hi, I'm sorry to hear that your flight was delayed. If you haven't already - please send us a claim at https://t.co/oKlCwpbkfG to request reimbursement and compensation.

Best regards,
Anton.

@QuestionofA Hi, if you still need help please contact us on live chat or phone and we can help you take a look at what the possibilities are for changing departure date https://t.co/b3QIqPkF0R

Best regards,
Anton.

@dacatania @dacatania Hi, you should be able to update the information on your report on this website https://t.co/2zwsPbhQFU
Otherwise, please contact the Baggage Service at the airport.
Kind regards, Mikael.

@o07557174 Hi,
As a result of the pilot strike, we have a lot of cases to deal with. . We have deployed all the resources we can to speed up the process and deal with all cases in turn.
Kind regards, Lena

@MozFreak Hi,
As a result of the pilot strike, we have a lot of cases to deal with. We have deployed all the resources we can to speed up the process and deal with all cases in turn.
Kind regards, Lena

@nomadposts Hi,
As a result of the pilot strike, we have a lot of cases to deal with.  We have deployed all the resources we can to speed up the process and deal with all cases in turn. 
Kind regards, Lena

@solex_agitator Hi! We can have a look at the possibilities for you, please contact us at Costumer Service by chat or phone so we can help you further: https://t.co/b3QIqPk7bj
Kind regards, 
Julia

@Yalemisew Hi. I recommend you to edit your tweet to remove your booking reference as it contains sensitive information. Please make sure to contact Baggage Service for further support in this matter. 
Kind regards,
Johanna

@icegirl_2 Hello! We are truly sorry for the inconvenience! Unfortunatly though, we are unable to assist you with this over social media. For assist please contact our customer service. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@axen_bob Hello! Unfortunatly we are unable to assist you with this over social media. Please contact our customer service for assist. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@OrmeAnthony Hi, we are not able to look into individual cases over Twitter unfortunately, but it happens sometimes that seating is changed, but the seating category should not have been changed (aisle, window, extra legroom) etc. The row number though may be changed.

Best regards,
Anton.

@sarahskarum Hej, biljetterna läggs ut till försäljning cirka 300-330 dagar före avresa så i det här fallet får jag be dig att avvakta lite till och hålla utkik på vår hemsida.

Med vänlig hälsning,
Anton.

@iris_sioson Hi, for more information about the procedures of localizing delayed luggage and for information about your luggage please contact SAS Baggage Service https://t.co/ZV9bTO3uo2

Best regards,
Anton.

@cangrumble Hi, Please try clearing your cache and cookies in Chrome. If you use a VPN service, try set the location to a nearby VPN server or turn it off temporarily. This usually solves the issue you are having on our website.

Best regards,
Anton.

@qtnguyen713 Hello, online check-in for SAS flights opens 30 hours before departure.

Best regards,
Anton.

@RebWedel Hello, SK946 ORD - ARN September 5th is still planned to depart. If anything changes you will be notified directly on email and/or sms.

Best regards,
Anton.

@andraanna Hej! Vi har inte information om just Helsingfors flygplats ännu, men så snart den kommer igång så kommer vi informera om det på https://t.co/bG6acgHGid samt https://t.co/63gRjhqYUS
Vänliga hälsningar, 
Rebecka
